import React, { useState } from 'react';
import { Instagram, Facebook, MessageCircle, Clock, MapPin, Tablet, ShoppingBag } from 'lucide-react';
import LandingPage from './LandingPage';
import ProfilUMKM from './ProfilUMKM';
import Katalog from './Katalog';

function App() {
  const [activePage, setActivePage] = useState('Beranda');

  return (
    <div className="min-h-screen bg-white font-sans text-gray-800">
      {/* NAVBAR */}
      <nav className="flex justify-between items-center px-10 py-4 border-b border-gray-100 sticky top-0 bg-white z-50">
        <div className="flex items-center gap-2">
          <div className="w-10 h-10 bg-gray-200 rounded-full flex items-center justify-center overflow-hidden">
            <img src="https://via.placeholder.com/40" alt="logo" />
          </div>
          <span className="font-semibold text-gray-500">Scenthusiasm</span>
        </div>
        <ul className="flex gap-8 text-sm font-medium">
          {['Beranda', 'Profile UMKM', 'Produk/Katalog', 'Kontak'].map((item) => (
            <li 
              key={item}
              onClick={() => setActivePage(item)}
              className={`cursor-pointer pb-1 transition-all ${
                activePage === item ? 'text-purple-600 border-b-2 border-purple-600' : 'text-gray-400 hover:text-purple-400'
              }`}
            >
              {item}
            </li>
          ))}
        </ul>
      </nav>

      {/* RENDER HALAMAN DINAMIS */}
      <main>
        {activePage === 'Beranda' && <LandingPage />}
        {activePage === 'Profile UMKM' && <ProfilUMKM />}
        {activePage === 'Produk/Katalog' && <Katalog />}
        {activePage === 'Kontak' && (
          <div className="py-20 text-center text-gray-400 italic">Halaman Kontak dalam pengembangan.</div>
        )}
      </main>

      {/* FOOTER */}
      <footer className="px-16 py-12 bg-white border-t border-gray-100">
        <div className="flex items-center gap-3 mb-4">
          <h3 className="text-xl font-bold text-purple-600">Hubungi <span className="text-orange-400">Kami</span></h3>
          <div className="flex gap-4 ml-4">
            <Instagram size={24} className="text-pink-500 cursor-pointer hover:scale-110 transition" />
            <Facebook size={24} className="text-blue-600 cursor-pointer hover:scale-110 transition" />
            <Tablet size={24} className="text-cyan-500 cursor-pointer hover:scale-110 transition" />
            <MessageCircle size={24} className="text-green-500 cursor-pointer hover:scale-110 transition" />
            <ShoppingBag size={24} className="text-orange-600 cursor-pointer hover:scale-110 transition" />
          </div>
        </div>
        <p className="text-xs text-gray-500 mb-8">
          Hubungi kami melalui <span className="text-orange-400 font-semibold">WhatsApp</span> kami siap melayani Anda sesuai jam kerja.
        </p>
        <div className="space-y-3">
          <div className="flex items-center gap-3 text-sm text-gray-600">
            <div className="p-1.5 border border-orange-200 rounded-full">
              <Clock size={16} className="text-orange-400" />
            </div>
            <span>Senin-Jumat - 08.00 - 17.00</span>
          </div>
          <div className="flex items-center gap-3 text-sm text-gray-600">
            <div className="p-1.5 border border-orange-200 rounded-full">
              <MapPin size={16} className="text-orange-400" />
            </div>
            <span>Pekanbaru, Riau</span>
          </div>
        </div>
      </footer>
    </div>
  );
}

export default App;
